import React, { Component } from 'react';
import './App.css';
import Navi from './components/Navi/Navi';
import Textbar from './components/Textbar/Textbar';
import Content from './components/Content/Content';


class App extends Component {
  render(){
    return (
      <div className='App'>
        <div className='box'>
          <Navi id='form1'/>
          <Textbar id='form2'/>
          <Content id='form3'/>
        </div>
      </div>
    );
  }
}

export default App;
